let padZero l1 l2 = 
  let diff = List.length l1 - List.length l2 in
    if (diff < 0) then (List.append (clone 0 (abs diff)) l1,l2) else if (diff > 0) then (l1,List.append (clone 0 diff) l2) else (l1,l2)




