let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = let sum = fst a + (fst x + snd x) in
        (sum/10, (sum mod 10)::snd a) in
    let base = (0,[]) in
    let args = List.combine (List.rev l1) (List.rev l2) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero (0::l1) (0::l2)))

