let rec mulByDigit i l = 
  let rec mulHelper c m l r = match l with 
    | [] -> 
        r
    | h::t ->
        mulHelper ((m*h + c)/10) m t (((m*h + c) mod 10)::r)
  in
    mulHelper 0 i (List.rev (0::l)) []


