let bigMul l1 l2 = 
  let f a x = ((fst a) + 1, bigAdd (snd a) (List.append (mulByDigit x l1) (clone 0 (fst a)))) in
  let base = (0,[]) in
  let args = List.rev l2 in
  let (_, res) = List.fold_left f base args in
    res



